import React from 'react';
import ProductCard from './ProductCard';

function ProductList({products}){

    const displayProducts = products.map((product) => (
     <ProductCard  key = {product.id} 
     name = {product.title} 

     />
    ))
    return(
        <>
        {displayProducts}
        </>
    )
}

export default ProductList;
